import React from 'react';
import {BrowserRouter, NavLink} from "react-router-dom";

function App() {
  return (
      <BrowserRouter>
        <p>Happy hacking!</p>
        <p><NavLink to="/login"/>Логин</p>
        {/* <p><NavLink to="/registration"/>Регистрация</p> */}
      </BrowserRouter>
  );
}

export default App;
